import React from 'react';

function Features() {
  return (
    <div className="bg-dark text-white py-8">
      <div className="container mx-auto px-6 md:px-12 lg:px-24 grid grid-cols-1 sm:grid-cols-2 md:grid-cols-4 gap-8">
        {/* AI-Powered Call Handling */}
        <div>
          <h5 className="text-aqua-text text-lg font-bold mb-2">AI-Powered Call Handling</h5>
          <p>The AI assistant skillfully manages every call, ensuring personalized interaction and efficient handling.</p>
        </div>

        {/* Intelligent Call Routing */}
        <div>
          <h5 className="text-aqua-text text-lg font-bold mb-2">Intelligent Call Routing</h5>
          <p>The AI assistant intelligently navigates calls to the correct destination, enhancing customer service efficiency.</p>
        </div>

        {/* Round-the-Clock Service */}
        <div>
          <h5 className="text-aqua-text text-lg font-bold mb-2">24/7 Service</h5>
          <p>Our AI service operates continuously, ensuring no call ever goes unanswered, any time of the day.</p>
        </div>

        {/* Live Call Transcription */}
        <div>
          <h5 className="text-aqua-text text-lg font-bold mb-2">Live Call Transcription</h5>
          <p>Every conversation is transcribed in real-time, providing valuable insights and records of each interaction.</p>
        </div>

        {/* Seamless Call Transfer */}
        <div>
          <h5 className="text-aqua-text text-lg font-bold mb-2">Seamless Call Transfer</h5>
          <p>The AI confirms the availability of the receiver before transferring calls, ensuring smooth communication.</p>
        </div>

        {/* Call Recording and Storage */}
        <div>
          <h5 className="text-aqua-text text-lg font-bold mb-2">Call Recording and Storage</h5>
          <p>Calls are recorded and securely stored, offering easy access to historical data and compliance support.</p>
        </div>

        {/* Advanced Voice Recognition */}
        <div>
          <h5 className="text-aqua-text text-lg font-bold mb-2">Advanced Voice Recognition</h5>
          <p>Utilizing the latest in voice recognition technology, the AI understands and responds to a wide range of speech patterns.</p>
        </div>

        {/* Real-Time Analytics */}
        <div>
          <h5 className="text-aqua-text text-lg font-bold mb-2">Real-Time Analytics</h5>
          <p>Gain immediate insights into call patterns, customer queries, and service performance with real-time analytics.</p>
        </div>
      </div>
    </div>
  );
}

export default Features;
